import { makeStyles } from '@material-ui/core/styles';

const DrawerStyle = makeStyles((theme) => ({
    body: {
        backgroundColor: '#F5F5F5',
        height: 'inherit'
    },
    head: {
        backgroundColor: '#FFFFFF',
    },
    gray: {
        color: '#666666',
    },
}));

export default DrawerStyle;
